    false,nt"url": null,nt"notes": "This report summarizes a survey of the
    submergent and emergent aquatics growing in the marsh on the Canvasback Gun Club
    in Nevada. As stated in previous years of this survey, the Canvasback Gun Club is
    almost entirely composed of a mature marsh with just a few shallow ponds around
    the edge providing nearly all of the waterfowl food for the Club.  The area will
    remain this way until some work is done to control the individual units. As a good
    dewatering program has already been recommended, nothing more need be said on this
    subject.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
